content:
집에 가면 라면향 맡는건가요?ㅋㅋ
&quot;라면 먹고 갈래요?&quot;
상상하지마~~~

그러고보니 맹도견들은 외출 중 볼일을 어떻게 해결하나요?
만일 배변을 봤다면 주인이 어떻게 치워주나요?
여기선 모종삽으로 파묻은것 같은데 보일리가 없잖아요 ;

아니 뭐가 어찌됐든 개보단 사람이 낫지 않냐; 
개-&gt;사람 이면 몰라도 
사람-&gt;개 라면 
어지간히 막장인생 아니고서야 
답답해서 살겠나;

이거 오늘 갑자기 든 생각인데...
승희씨가 영수씨 목소리가 낮은 곳에서 들리는걸 인지 못하는게... 현실감이 떨어지는거 같지만.. 
그래도 넘 잼나게 잘 보고 있습니다.^^;

나리 왜 이렇게 귀엽니&gt;_&lt;
승희 무릎 배고 자는 보듬이도, 승희씨도, 종영이도, 은지씨도...
이 사람들과 함께라면 영수의 저 웃음은 앞으로 계속 될듯....

똥개 영수가 저렇게 잘 생겼었다니ㄷㄷㄷ;;;
단 하루이지만 그 하루부터가 진짜 행복의 시작일 것 같네요..
이런 결말이 참 아쉬우면서도 잔잔하게 남는 것이 더 많은 것 같습니다^-^
